// import axios from 'axios';
import {BrowserRouter, Routes, Route } from 'react-router-dom'
import {Home} from './Home.jsx'
export const Info =(props)=>{
   const Err=()=>{
      return(
          <h1>error page</h1>
      )
          };
 
   return (
      
       <BrowserRouter>
    <Routes>
        <Route path="/" element={<Home sums={props.summary} />} />
       

      </Routes>
      </BrowserRouter>
      
      
      
   )

}
